import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const Home = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true
  };

  return (
    <Slider {...settings}>
      <div>
        <img src="https://tse2.mm.bing.net/th/id/OIP.PJKm8bKeYjeuhxEKjHsqBwHaEK?w=267&h=180&c=7&r=0&o=5&dpr=1.5&pid=1.7" alt="Image 1" width={{height:"100px",width:"100px"}} />
      </div>
      <div>
        <img src="image2.jpg" alt="Image 2" />
      </div>
      <div>
        <img src="image3.jpg" alt="Image 3" />
      </div>
      <div>
        <img src="image4.jpg" alt="Image 4" />
      </div>
    </Slider>
  );
}

export default Home;
